import React from "react";
import styled from "styled-components";
import withImages from "next-images";

import NavbarComp from "../UI/NavbarComp";

import HeroCar from "../../public/static/images/landing/hero-car.png";

const Landing = () => {
  return (
    <Container>
      <NavbarComp />
      <HeroDiv className="hero-background">
        <div>
          <h3>Sam's Auto</h3>
        </div>
      </HeroDiv>
      <HeroContent>
        <div></div>
        <div className="hero-">
          <p>For all your automotive needs</p>
          <ButtonContainer>Read More</ButtonContainer>
        </div>
      </HeroContent>
    </Container>
  );
};

export default Landing;

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #151515;
  font-family: "Quicksand", sans-serif;
  color: white;
`;
const HeroDiv = styled.div`
  width: 100vw;
  height: 424px;
  background: url("/static/images/landing/hero-normal.png") center center
    no-repeat;
  background-size: cover;
  div {
    background: rgba(67, 67, 67, 0.44);
    height: 60%;
    transform: translate3d(0, 35%, 0);
  }
  h3 {
    transform: translate3d(0, 20%, 0);
    width: 50%;
    margin: 0 auto;
    font-family: "Quicksand";
    font-style: normal;
    font-weight: normal;
    font-size: 80px;
    line-height: 105px;
    text-align: center;
    letter-spacing: 0.725em;
    text-transform: uppercase;
  }
`;

const HeroContent = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  height: 30vh;
  .hero-content {
    width: 100%;
  }
  p {
    font-family: "Quicksand";
    font-style: normal;
    font-weight: normal;
    font-size: 32px;
    line-height: 42px;
    letter-spacing: 0.27em;
    color: #eeeeee;
  }
`;
const ButtonContainer = styled.button`
  clip-path: polygon(25% 0%, 100% 0%, 75% 100%, 0% 100%);
  width: 350px;
  height: 60px;
  border: 3px solid #ff3838;
  box-shadow: 0px 6px 4px rgba(232, 107, 107, 0.25);
  background-color: #151515;
  color: white;
  font-family: Racing Sans One;
  font-style: normal;
  font-weight: normal;
  font-size: 32px;
  line-height: 40px;
  text-align: center;

  color: #d1d7d8;
`;
